      <text id="161" justification="0" size="4" underlined="false">
        <text>Die abstrakte Klasse Menge ist generisch.
Deren Spezialisierung legt den Inhaltstyp fest.
 
Dieser gebundene Inhaltstyp der spezialisierten Menge muss 
eine Spezialisierung der abstrakten Klasse Element sein, d.h. 
der konkrete Inhaltstyp muss also von der Klasse Element erben.
 
Um diese Spezialisierungsnotwendigkeit zu verdeutlichen, ist 
der Vererbungspfeil vom Inhaltstyp der generischen Menge 
zur Klasse Element eingezeichnet.
 
Letztlich verwaltet also jede Menge spezialisierte Elemente.</text>
      </text>
